  \"2016-11-25T21:06:38.751957\",\n\t\"name\": \"trends-in-international-mathematics-and-science-study-2003\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Trends in International Mathematics
  and Science Study, 2003 (TIMSS 2003), is part of the Trends in International Mathematics
  and Science Study (TIMSS) program. TIMSS 2003 (http://nces.ed.gov/timss/) is a cross-sectional
  study that provides international comparative information of the mathematics and
  science literacy of fourth- and eighth-grade students and examines factors that
  may be associated with the acquisition of math and science literacy in students.
  The study was conducted using direct assessments of students and questionnaires
  for students, teachers, and school administrators. Fourth- and eighth-graders in
  the 2002-03 school year were sampled. The weighted student response rate at grade
  four was 95 percent, and the weighted student response rate at grade eight was 94
  percent. Key statistics produced from TIMSS 2003 are mathematics and science achievement
  scores of U.S. fourth- and eighth- grade students compared to that of students in
  other countries.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
